import Vue from "vue"
import vueRouter from "vue-router"

Vue.use(vueRouter)


const router = new vueRouter({
    routes:[
        {
            path:"/",
            redirect:"/home"
        },{
            path:"/home",
            component:()=> import("@/views/Home/Home")
        }
        
    ]
})

export default router
